import React, {useState} from "react"

function Register()
{
    const [userName, setName] = useState(" ")
    const [userEmail, setEmail] = useState(" ")
    const [userContact, setContact] = useState(" ")
    const [userDOB, setDOB] = useState(" ")
    const [userPassword, setPassword] = useState(" ")

    return (
        <div>
            <h1>Register Page</h1>
            <input type="text" value={use} onChange={(e)=>setName(e.target.value)} placeholder="Name" /> <br/><br/>
            <input type="text" onChange={(e)=>setEmail(e.target.value)} placeholder="Email" /> <br/><br/>
            <input type="text" onChange={(e)=>setContact(e.target.value)} placeholder="Contact" /> <br/><br/>
            <input type="text" onChange={(e)=>setDOB(e.target.value)} placeholder="DOB" /> <br/><br/>
            <input type="password" onChange={(e)=>setPassword(e.target.value)} placeholder="Password" /> <br/><br/>
            <input type="password" placeholder="Confirm Password" /> <br/><br/>
            <button className="btn btn-primary">Sign Up</button> <br/><br/>
        </div>
    )
}

export default Register
